      const result = await api.get("https://api.twitch.tv/helix/games/top");
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1 className="titreGames">Jeux les plus populaires</h1>

      <div className="felxAccueil"></div>
    </div>
  );
}

export default Games;
